import React from 'react'
import Card from './components/Card'
import styled from 'styled-components'

const StyledCeramics = styled.div`
  // background-color: hotpink;
  display: flex;
  height: 100vh;
`

const StyledCards = styled.div`
  background-color: hotpink;
  height: 250px;
  width: 100px;
  margin: 0 1rem;
`

const Cards = ['one', 'two', 'three']

const Ceramics = (props) => {
  return (
    <StyledCeramics>
      { Cards.map(elem => {
        return (
          <StyledCards>
            <div>
              { elem }
            </div>
          </StyledCards> 
        )
      }
    )}
    </StyledCeramics>
  )
}

export default Ceramics
